jenkins:
  agentProtocols:
  - "JNLP4-connect"
  - "Ping"
  authorizationStrategy:
    globalMatrix:
      permissions:
      - "USER:Agent/Build:adm"
      - "USER:Agent/Configure:adm"
      - "USER:Agent/Connect:adm"
      - "USER:Agent/Create:adm"
      - "USER:Agent/Delete:adm"
      - "USER:Agent/Disconnect:adm"
      - "USER:Job/Build:adm"
      - "USER:Job/Cancel:adm"
      - "USER:Job/Configure:adm"
      - "USER:Job/Create:adm"
      - "USER:Job/Delete:adm"
      - "USER:Job/Discover:adm"
      - "USER:Job/Read:adm"
      - "USER:Job/Read:view"
      - "USER:Job/Workspace:adm"
      - "USER:Lockable Resources/Reserve:adm"
      - "USER:Lockable Resources/Reserve:view"
      - "USER:Lockable Resources/Steal:adm"
      - "USER:Lockable Resources/Unlock:adm"
      - "USER:Lockable Resources/View:adm"
      - "USER:Overall/Administer:adm"
      - "USER:Overall/Read:adm"
      - "USER:Overall/Read:view"
      - "USER:Run/Delete:adm"
      - "USER:Run/Replay:adm"
      - "USER:Run/Update:adm"
      - "USER:View/Configure:adm"
      - "USER:View/Create:adm"
      - "USER:View/Delete:adm"
      - "USER:View/Read:adm"
      - "USER:View/Read:view"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  labelAtoms:
  - name: "built-in"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  numExecutors: 2
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
      - id: "adm"
        name: "Some adm"
        properties:
        - "apiToken"
        - "myView"
        - preferredProvider:
            providerId: "default"
        - "timezone"
        - mailer:
            emailAddress: "m@m.sk"
      - id: "view"
        name: "view"
        properties:
        - "apiToken"
        - "myView"
        - preferredProvider:
            providerId: "default"
        - "timezone"
        - mailer:
            emailAddress: "v.m@p.sk"
  slaveAgentPort: 0
  updateCenter:
    sites:
    - id: "default"
      url: "https://updates.jenkins.io/update-center.json"
  views:
  - all:
      name: "all"
  viewsTabBar: "standard"
security:
  apiToken:
    creationOfLegacyTokenEnabled: false
    tokenGenerationOnCreationEnabled: false
    usageStatisticsEnabled: true
  sSHD:
    port: -1
unclassified:
  buildDiscarders:
